import React, { useState } from 'react';
import './App.css';


function App() {
  const [count, setCount] = useState(0);
  return (
   <div>
     <h1>nnn</h1>
     <p>You clicked {count} times</p>
      <button onClick={() => setCount(count + 1)}>
        Click me
      </button>
   </div>
  );
}

export default App;
